<p>–í—Å–µ–≥–¥–∞ –≤ —Ç–æ–Ω—É—Å–µ! –ö—Å—Ç–∞—Ç–∏, –≤—ã–µ–∑–¥ –æ—Ç –¥–≤—É—Ö —á–∞—Å–∏–∫–æ–≤. –ï—Å—Ç—å –∫—Ä–∞—Å–∏–≤–∞—è –ø–æ–¥—Ä—É–∂–∫–∞ Online –ö–∞–º–µ–Ω–∫–∞-–ë—É–≥—Å–∫–∞—è. –û–¥–Ω–∞ –∫–æ—Ñ–µ –≤ –ø–æ—Å—Ç–µ–ª—å, –≤—Ç–æ—Ä–∞—è –≤ –ø–æ—Å—Ç–µ–ª–∏ –∞ —Ç—Ä–µ—Ç—å—è —Å–∞–º –ø—Ä–∏–¥—É–º–∞–π Online –ü–µ—Ä—à–æ—Ç—Ä–∞–≤–µ–Ω—Å–∫. –í—ã –≤—Å–µ –µ—â–µ –Ω–µ –∑–∞—Ä–µ–≥–∏—Å—Ç—Ä–∏—Ä–æ–≤–∞–Ω—ã? –ü—Ä–æ–π–¥–∏—Ç–µ –ø—Ä–æ—Å—Ç—É—é —Ä–µ–≥–∏—Å—Ç—Ä–∞—Ü–∏—é, —ç—Ç–æ –Ω–µ –∑–∞–π–º–µ—Ç –æ—á–µ–Ω—å –º–Ω–æ–≥–æ –≤–∞—à–µ–≥–æ –≤—Ä–µ–º–µ–Ω–∏! –ì–ª–∞–≤–Ω–∞—è –û–Ω–ª–∞–π–Ω –∑–Ω–∞–∫–æ–º—Å—Ç–≤–∞ –ú—É–∫–∞—á–µ–≤–æ –ü—Ä–æ—Å—Ç–∏—Ç—É—Ç–∫–∏ –∏–Ω–¥–∏–≤–∏–¥—É–∞–ª–∫–∏ –ú—É–∫–∞—á–µ–≤–æ –í—ã–±—Ä–∞—Ç—å –≥–æ—Ä–æ–¥. –ò–Ω—Ç–∏–º –¥–æ—Å—É–≥ –ö–∏—Ä–∞ –ú—É–∫–∞—á–µ–≤–æ - –û–±—ä—è–≤–ª–µ–Ω–∏–µ –ü—Ä–æ—Å—Ç–∏—Ç—É—Ç–∫–∏ –∑–∞ —Ä. –ú—É–∫–∞—á–µ–≤–æ –¢–µ–ª–µ—Ñ–æ–Ω: –ò–Ω—Ç–∏–º –¥–æ—Å—É–≥ –ü—Ä–µ–∂–¥–µ —á–µ–º –∫—Ç–æ- –ª–∏–±–æ –∏–∑ –Ω–∞—Å —á—Ç–æ- —Ç–æ —Å–æ–æ–±—Ä–∞–∑–∏–ª, –≤—Ç–æ—Ä–∞—è –¥–µ–≤–æ—á–∫–∞ —Å —É–ª—ã–±–∫–æ–π –Ω–∞ –ª–∏—Ü–µ –ø—Ä–∏–ø–æ–¥–Ω—è–ª–∞ –ø–æ–¥–æ–ª –ø–ª–∞—Ç—å—è, –ø–æ–¥ –∫–æ—Ç–æ—Ä—ã–º –≤—Å–ª–µ–¥—Å—Ç–≤–∏–µ –æ—Ç—Å—É—Ç—Å—Ç–≤–∏—è —Ç—Ä—É—Å–∏–∫–æ–≤ –≤–º–µ—Å—Ç–æ —â–µ–ª–æ—á–∫–∏ –≤–∏–¥–Ω–µ–ª—Å—è –º–∞–ª–µ–Ω—å–∫–∏–π –∫—Ä—é—á–æ–∫.</p>
<p>–¢–∏–º—É—Ä –∑–∞–º–µ—Ç–∏–ª —Ä–∞–∑–∏—Ç–µ–ª—å–Ω—É—é –ø–µ—Ä–µ–º–µ–Ω—É –≤ –ø–æ–≤–µ–¥–µ–Ω–∏–∏ –∫—Ä–∞—Å–∏–≤–æ–π –∂–µ–Ω—â–∏–Ω—ã. –ê–ª–µ–Ω–∞ –∑–∞. –ë–î–°–ú –°–∞–¥–æ-–º–∞–∑–æ : –ë–∞–Ω–¥–∞–∂ –ì–æ—Å–ø–æ–∂–∞ –†–∞–±—ã–Ω—è –î–æ–º–∏–Ω–∞—Ü–∏—è –ü–æ—Ä–∫–∞ –§–µ—Ç–∏—à –¢—Ä–∞–º–ø–ª–∏–Ω–≥ –≠–∫—Å—Ç—Ä–∏–º: –°—Ç—Ä–∞–ø–æ–Ω –î–µ–ª–∞—é –∞–Ω–∏–ª–∏–Ω–≥—É—Å –í—ã–¥–∞—é –∑–æ–ª–æ—Ç–æ–π –¥–æ–∂–¥—å –ü—Ä–∏–Ω–∏–º–∞—é –∑–æ–ª–æ—Ç–æ–π –¥–æ–∂–¥—å –ö–æ–ø—Ä–æ—Ñ–∞–≥–∏—è –≤—ã–¥–∞—á–∞ –§–∏—Å—Ç–∏–Ω–≥ –∞–Ω–∞–ª—å–Ω—ã–π –§–∏—Å—Ç–∏–Ω–≥ –∫–ª–∞—Å—Å–∏—á–µ—Å–∫–∏–π –ú–∞—Å—Å–∞–∂: –≠—Ä–æ—Ç–∏—á–µ—Å–∫–∏–π –ë–æ–¥–∏ –º–∞—Å—Å–∞–∂ –õ–∏–Ω–≥–∞–º–∞ –º–∞—Å—Å–∞–∂ –†–∞—Å—Å–ª–∞–±–ª—è—é—â–∏–π –ö–ª–∞—Å—Å–∏—á–µ—Å–∫–∏–π –ü—Ä–æ—Ñ–µ—Å—Å–∏–æ–Ω–∞–ª—å–Ω—ã–π –£—Ä–æ–ª–æ–≥–∏—á–µ—Å–∫–∏–π –í–µ—Ç–∫–∞ —Å–∞–∫—É—Ä—ã.</p>
<p>–ö–∏—Ä–∞ –æ–Ω–ª–∞–π–Ω –∏ —Ö–æ—á–µ—Ç –æ–±—â–∞—Ç—Å—è! –£ –º–∞—Ç–µ—Ä—ñ–∞–ª–∞—Ö –∑ –æ–∑–Ω–∞–∫–∞–º–∏ –∑–∞–º–æ–≤–Ω–æ—Å—Ç—ñ —á–∏—Ç–∞—î–º–æ –ø—Ä–æ —Ç–µ, —â–æ "–≤ —É–º–æ–≤–∞—Ö –≤–∞–∂–∫–æ—ó –∫—Ä–∏–∑–∏ —É—Ä—è–¥ –ø–æ–ª–∏—à–∏–≤ –ª—é–¥–µ–π —ñ –ø—ñ–¥–ø—Ä–∏—î–º—Å—Ç–≤–∞ –£–∫—Ä–∞—ó–Ω–∏ –Ω–∞–ø—Ä–∏–∑–≤–æ–ª—è—â–µ", –∞–±–æ –∂ –ø—Ä–æ —Ç–µ, —â–æ –ª—é–¥–∏ "–∑ –º—ñ–∑–µ—Ä–Ω–∏–º–∏ –ø–µ–Ω—Å—ñ—è–º–∏ —Ç–∞ —Å–æ—Ü—ñ–∞–ª—å–Ω–∏–º–∏ –¥–æ–ø–æ–º–æ–≥–∞–º–∏ —Ñ–∞–∫—Ç–∏—á–Ω–æ –∫–∏–Ω—É—Ç—ñ –∑–∞ –º–µ–∂—É –±—ñ–¥–Ω–æ—Å—Ç—ñ". –ê–ª–µ –∂–æ–¥–Ω–∏—Ö –∞—Ä–≥—É–º–µ–Ω—Ç—ñ–≤ —á–∏ —Ñ–∞–∫—Ç–∏—á–Ω–æ–≥–æ –ø—ñ–¥—Ç–≤–µ—Ä–¥–∂–µ–Ω–Ω—è —Ü–∏–º –µ–º–æ—Ü—ñ–π–Ω–∏–º –≤–∏—Å–ª–æ–≤–∞–º –Ω–µ –∑–Ω–∞—Ö–æ–¥–∏–º–æ. –©–æ–¥–æ —Å–∏—Ç—É–∞—Ü—ñ—ó –≤ —Ä–µ–≥—ñ–æ–Ω–∞—Ö, —Ç–æ –Ω–∞–π–Ω–∏–∂—á—ñ –æ—Ü—ñ–Ω–∫–∏ –æ—Ç—Ä–∏–º–∞–ª–∏ –≤–∏–¥–∞–Ω–Ω—è –î–æ–Ω–µ—á—á–∏–Ω–∏, –°—É–º—â–∏–Ω–∏ —Ç–∞ –õ—å–≤—ñ–≤—â–∏–Ω–∏, –Ω–∞–π–≤–∏—â—ñ ‚Äî –≥–∞–∑–µ—Ç–∏ –î–Ω—ñ–ø—Ä–æ–ø–µ—Ç—Ä–æ–≤—â–∏–Ω–∏, –ë—É–∫–æ–≤–∏–Ω–∏ —Ç–∞ –ñ–∏—Ç–æ–º–∏—Ä—â–∏–Ω–∏.</p>
