	<p>–ü—Ä–∏–º—ñ—Ä–æ–º, –Ω–∏–∑—å–∫—ñ –ø–æ–∫–∞–∑–Ω–∏–∫–∏ –¥–∂–∏–Ω—Å–∏ –º–æ–∂—É—Ç—å —Å–≤—ñ–¥—á–∏—Ç–∏ –Ω–µ —Ç–∞–∫ –ø—Ä–æ —è–∫—ñ—Å—Ç—å –∫–æ–Ω—Ç–µ–Ω—Ç—É, —è–∫ –ø—Ä–æ –Ω–∏–∑—å–∫—É –ø–æ–ø—É–ª—è—Ä–Ω—ñ—Å—Ç—å —Å–∞–π—Ç—ñ–≤ —ñ –Ω–µ–∑–¥–∞—Ç–Ω—ñ—Å—Ç—å –º—ñ—Å—Ü–µ–≤–∏—Ö –ó–ú–Ü –∑–∞–ª—É—á–∞—Ç–∏ —Ä–µ–∫–ª–∞–º—É –Ω–∞ —Å–≤–æ—ó —Å–∞–π—Ç–∏. –ê –¥–µ—â–æ –≤–∏—â—ñ –æ—Ü—ñ–Ω–∫–∏ –∑–∞ —Å—Ç–∞–Ω–¥–∞—Ä—Ç–∏ –≤ –¥–µ—è–∫–∏—Ö –≤–∏–¥–∞–Ω—å –ø–æ—Ç—Ä—ñ–±–Ω–æ –∑—ñ—Å—Ç–∞–≤–ª—è—Ç–∏ –∑ –¥–∞–Ω–∏–º–∏ –ø—Ä–æ –ø–æ—Ö–æ–¥–∂–µ–Ω–Ω—è –º–∞—Ç–µ—Ä—ñ–∞–ª—ñ–≤: –¥—É–∂–µ —á–∞—Å—Ç–æ —Å–∞–π—Ç–∏ –∑–∞–ø–æ–∑–∏—á—É—é—Ç—å —è–∫—ñ—Å–Ω—ñ —Ç–µ–∫—Å—Ç–∏ –∑ —ñ–Ω—à–∏—Ö –ó–ú–Ü. –û—Å–Ω–æ–≤–Ω—ñ —Ç–µ–º–∏ —Ç–∞ —Ç–æ–Ω–∞–ª—å–Ω—ñ—Å—Ç—å –º–∞—Ç–µ—Ä—ñ–∞–ª—ñ–≤ –æ–Ω–ª–∞–π–Ω.</p>
<p>–í–∏—Å–≤—ñ—Ç–ª—é—é—á–∏ –ø–µ—Ä—à—ñ –¥–≤—ñ —Ç–µ–º–∏, –µ–ª–µ–∫—Ç—Ä–æ–Ω–Ω—ñ –≤–µ—Ä—Å—ñ—ó –≥–∞–∑–µ—Ç –æ—Ä—ñ—î–Ω—Ç—É–≤–∞–ª–∏—Å—è –Ω–µ —Ç–∞–∫ –Ω–∞ —Ä–µ–∞–ª—å–Ω—ñ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ–π–Ω—ñ –ø—Ä–∏–≤–æ–¥–∏, —è–∫ –Ω–∞ —Ç—ñ, —â–æ —ó—Ö —Å—Ç–≤–æ—Ä—é–≤–∞–ª–∞ –º—ñ—Å—Ü–µ–≤–∞ –≤–ª–∞–¥–∞, –ø–µ—Ä–µ–¥—Ä—É–∫–æ–≤—É—é—á–∏ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è —ñ–∑ —Å–∞–π—Ç—ñ–≤ –æ—Ä–≥–∞–Ω—ñ–≤ –º—ñ—Å—Ü–µ–≤–æ–≥–æ —Å–∞–º–æ–≤—Ä—è–¥—É–≤–∞–Ω–Ω—è. –Ü–Ω–∫–æ–ª–∏ –Ω–∞ —Å–∞–π—Ç–∏ "–ø–µ—Ä–µ–∫–æ—á–æ–≤—É–≤–∞–ª–∞" –π –ø–æ–ª—ñ—Ç–∏—á–Ω–∞ –¥–∂–∏–Ω—Å–∞, —Ç–æ–º—É —Ç–µ–º–∞ "–ø–æ–ª—ñ—Ç–∏–∫–∞" —Ç–∞–∫–æ–∂ –±—É–ª–∞ –ø–æ–ø—É–ª—è—Ä–Ω–æ—é. –¢—Ä–∞–ø–ª—è–ª–∏—Å—è –π –æ–≥–ª—è–¥–∏ –∑ —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—î—é –ø—Ä–æ –∫–∞–Ω–¥–∏–¥–∞—Ç—ñ–≤, –∞–ª–µ –∑–∞–∑–≤–∏—á–∞–π –ø–æ–¥–∞–≤–∞–ª–æ—Å—è –ª–∏—à–µ –¥–≤–∞-—Ç—Ä–∏ —Ä–µ—á–µ–Ω–Ω—è –ø—Ä–æ –∫–æ–∂–Ω–æ–≥–æ —Ç–∞ —Ñ–æ—Ç–æ.</p><img src="https://uzh.life/images/2020/11/14/prostit_zhittern_1.jpg" alt="" style="max-width: 480px; max-height: 480px;"/><p>–ë–µ–∑ –¥–æ–¥–∞—Ç–∫–æ–≤–æ—ó —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó –∞–±–æ –∞–Ω–∞–ª—ñ–∑—É. –û—Ç–∂–µ, –ø—ñ–¥—Ö–æ–¥–∏ –¥–æ –≤–∏—Å–≤—ñ—Ç–ª–µ–Ω–Ω—è —Ü–∏—Ö –¥–≤–æ—Ö —Ç–µ–º –Ω–∞ —Å–∞–π—Ç–∞—Ö —ñ –≤ –≥–∞–∑–µ—Ç–∞—Ö –∑–±—ñ–≥–∞—é—Ç—å—Å—è. –Ø–∫ –ø—Ä–∞–≤–∏–ª–æ, –Ω–∞ —Å–∞–π—Ç–∞—Ö –ø—Ä–æ—Å—Ç–æ –ø–µ—Ä–µ–¥—Ä—É–∫–æ–≤—É–≤–∞–ª–∞—Å—å –æ—Ñ—ñ—Ü—ñ–π–Ω–∞ —Å—Ç–∞—Ç–∏—Å—Ç–∏–∫–∞: –æ–¥–∏–Ω —Ç–µ–∫—Å—Ç –Ω–∞ –¥–µ–Ω—å ‚Äî —Ä–∞–π–æ–Ω, –æ–¥–∏–Ω —Ç–µ–∫—Å—Ç ‚Äî –æ–±–ª–∞—Å—Ç—å. –¶—è —Å—Ç–∞—Ç–∏—Å—Ç–∏–∫–∞ –Ω—ñ—è–∫ –Ω–µ –∞–Ω–∞–ª—ñ–∑—É–≤–∞–ª–∞—Å—è, –Ω–µ –¥–æ–ø–æ–≤–Ω—é–≤–∞–ª–∞—Å—è –∫–æ–º–µ–Ω—Ç–∞—Ä—è–º–∏, –∫–æ–Ω—Ç–µ–∫—Å—Ç –Ω–µ –¥–æ–¥–∞–≤–∞–≤—Å—è.</p>
<p>–í–∏–Ω—è—Ç–∫–æ–º —Å—Ç–∞–≤ —Å—É–º—Å—å–∫–∏–π —Å–∞–π—Ç "–ñ–õ news" –õ–µ–±–µ–¥–∏–Ω , —è–∫–∏–π –≥–æ—Ç—É–≤–∞–≤ –º–∞—Ç–µ—Ä—ñ–∞–ª–∏ –Ω–∞ –æ—Å–Ω–æ–≤—ñ –≤–ª–∞—Å–Ω–æ—ó —ñ–Ω—Ñ–æ—Ä–º–∞—Ü—ñ—ó " –£ –õ–µ–±–µ–¥–∏–Ω—ñ –Ω–∞ –∫–∞—Ä–∞–Ω—Ç–∏–Ω –∑–∞–∫—Ä–∏–ª–∏ —Ñ–∞–±—Ä–∏–∫—É " , –∞ —Ç–∞–∫–æ–∂ —Ä–æ–±–∏–≤ –æ–ø–∏—Ç—É–≤–∞–Ω–Ω—è –±–∞—Ç—å–∫—ñ–≤ —ñ –¥—ñ—Ç–µ–π " –ß–∏ —É—Å–≤—ñ–¥–æ–º–ª—é—é—Ç—å –≤–∞—à—ñ –¥—ñ—Ç–∏ –Ω–µ–±–µ–∑–ø–µ–∫—É –∫–æ—Ä–æ–Ω–∞–≤—ñ—Ä—É—Å—É? –ú–∞–π–∂–µ –≤—Å—ñ —Ç–µ–∫—Å—Ç–∏ –Ω–∞ —Ü—é —Ç–µ–º—É ‚Äî –ø–µ—Ä–µ–¥—Ä—É–∫–∏ –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω—å —Ä—ñ–∑–Ω–æ–º–∞–Ω—ñ—Ç–Ω–∏—Ö —Å–∏–ª–æ–≤–∏—Ö —Å—Ç—Ä—É–∫—Ç—É—Ä. –¢–∞–∫—ñ —Ç–µ–∫—Å—Ç–∏ –Ω–µ –ø–æ—Ä—É—à—É—é—Ç—å –≤–∞–∂–ª–∏–≤–∏—Ö –ø—Ä–æ–±–ª–µ–º, –Ω–µ –∑–∞—Å—Ç–µ—Ä—ñ–≥–∞—é—Ç—å —á–∏—Ç–∞—á—ñ–≤, –∞ –µ–º–æ—Ü—ñ–π–Ω–æ —á—ñ–ø–ª—è—é—Ç—å —ñ –∂–∞—Ö–∞—é—Ç—å. –á—Ö–Ω—î —Ä–æ–∑–º—ñ—â–µ–Ω–Ω—è –¥–æ–∑–≤–æ–ª—è—î —à–≤–∏–¥–∫–æ "–Ω–∞–∫—Ä—É—Ç–∏—Ç–∏" –ø–µ—Ä–µ–≥–ª—è–¥–∏ –π –∑–∞–ø–æ–≤–Ω–∏—Ç–∏ —Å—Ç—Ä—ñ—á–∫—É –Ω–æ–≤–∏–Ω –±–µ–∑ –∑–∞–π–≤–∏—Ö –∑—É—Å–∏–ª—å.</p><a id='m3'></a><h3>–ê—Å–æ—Ä—Ç–∏–º–µ–Ω—Ç —ñ–Ω—Ç–∏–º–Ω–∏—Ö —Ç–æ–≤–∞—Ä—ñ–≤ –≤ –ù–æ–≤–æ–≥—Ä–∞–¥-–í–æ–ª–∏–Ω—Å—å–∫–æ–º—É</h3><p>–í—ñ–¥—Å–æ—Ç–∫–∏ –º–∞–π–∂–µ –Ω–µ –∑–º—ñ–Ω–∏–ª–∏—Å—å, —è–∫—â–æ –ø–æ—Ä—ñ–≤–Ω—é–≤–∞—Ç–∏ –∑ —ñ–Ω—à–∏–º–∏ –ø–µ—Ä—ñ–æ–¥–∞–º–∏ –º–æ–Ω—ñ—Ç–æ—Ä–∏–Ω–≥—É. –ü–µ—Ä–µ–¥–≤–∏–±–æ—Ä—á–∞ –∫–∞–º–ø–∞–Ω—ñ—è –≤–Ω–µ—Å–ª–∞ –ø–æ–∂–≤–∞–≤–ª–µ–Ω–Ω—è –Ω–µ –ª–∏—à–µ –≤ —Ç–µ–º–∞—Ç–∏—á–Ω–µ —Ä—ñ–∑–Ω–æ–º–∞–Ω—ñ—Ç—Ç—è —Å–∞–π—Ç—ñ–≤, –∞–¥–∂–µ —Ç–µ–º–∞ "–ø–æ–ª—ñ—Ç–∏–∫–∞" –±—É–ª–∞ –∑–æ–≤—Å—ñ–º –Ω–µ –ø–æ–ø—É–ª—è—Ä–Ω–æ—é –≤ —Ç—Ä–∞–≤–Ω—ñ, –∞–ª–µ –π –ø—Ä–∏–∑–≤–µ–ª–∞ –¥–æ –∑–±—ñ–ª—å—à–µ–Ω–Ω—è –¥–∂–∏–Ω—Å–∏ –≤—Ç—Ä–∏—á—ñ. –ù–∞—Ç–æ–º—ñ—Å—Ç—å –∫—ñ–ª—å–∫—ñ—Å—Ç—å –æ—Ñ—ñ—Ü—ñ–æ–∑—É —Ç–∞ –Ω–µ–Ω–∞–ª–µ–∂–Ω–æ –º–∞—Ä–∫–æ–≤–∞–Ω–∏—Ö –º–∞—Ç–µ—Ä—ñ–∞–ª—ñ–≤ –∑–Ω–∏–∑–∏–ª–∞—Å—å.</p>
<p>–î–∂–µ—Ä–µ–ª–æ–º –¥–∂–∏–Ω—Å–∏ –¥–ª—è —Å–∞–π—Ç—ñ–≤ –Ω–∞–π—á–∞—Å—Ç—ñ—à–µ –≤–∏—Å—Ç—É–ø–∞–ª–∏ –¥—Ä—É–∫–æ–≤–∞–Ω—ñ –≤–µ—Ä—Å—ñ—ó, –¥–∂–µ—Ä–µ–ª–æ–º –æ—Ñ—ñ—Ü—ñ–æ–∑—É —Å—Ç–∞–≤–∞–ª–∏ –ø–µ—Ä–µ–¥—Ä—É–∫–∏ —Ç–µ–∫—Å—Ç—ñ–≤ —ñ–∑ —á–∏—Å–ª–µ–Ω–Ω–∏—Ö —Å–∞–π—Ç—ñ–≤ –æ—Ä–≥–∞–Ω—ñ–≤ –º—ñ—Å—Ü–µ–≤–æ–≥–æ —Å–∞–º–æ–≤—Ä—è–¥—É–≤–∞–Ω–Ω—è. –ù–µ–Ω–∞–ª–µ–∂–Ω–æ –º–∞—Ä–∫–æ–≤–∞–Ω—ñ –º–∞—Ç–µ—Ä—ñ–∞–ª–∏ —Ä–∞–Ω—ñ—à–µ –∑–∞–∑–≤–∏—á–∞–π —Å—Ç–æ—Å—É–≤–∞–ª–∏—Å—è —Å–∞–º–µ —Ä–µ–∫–ª–∞–º—É–≤–∞–Ω–Ω—è –º—ñ—Å—Ü–µ–≤–æ–≥–æ –±—ñ–∑–Ω–µ—Å—É, —Ç–æ–∂ –æ—á—ñ–∫—É–≤–∞–Ω–æ –ø—ñ–¥ —á–∞—Å –ø–µ—Ä–µ–¥–≤–∏–±–æ—Ä—á–æ—ó –∫–∞–º–ø–∞–Ω—ñ—ó –∫—ñ–ª—å–∫—ñ—Å—Ç—å –ø–æ–¥—ñ–±–Ω–æ–≥–æ –∫–æ–Ω—Ç–µ–Ω—Ç—É –≤–ø–∞–ª–∞. –ù–∞–π–ø–æ–ø—É–ª—è—Ä–Ω—ñ—à–æ—é —Ä—É–±—Ä–∏–∫–æ—é –¥–ª—è —Ä–æ–∑–º—ñ—â–µ–Ω–Ω—è —Ç–∞–∫–∏—Ö —Ç–µ–∫—Å—Ç—ñ–≤ –±—É–ª–∞ "–ü—Ä–æ–º–æ" "–ù–æ–≤–æ–≥—Ä–∞–¥. City", "–ë—ñ–ª—è—ó–≤–∫–∞. City", slk. –Ü–Ω–∫–æ–ª–∏ –∑—É—Å—Ç—Ä—ñ—á–∞–ª–æ—Å—è –Ω–µ–Ω–∞–ª–µ–∂–Ω–µ –º–∞—Ä–∫—É–≤–∞–Ω–Ω—è "–ü–†", –∑–∞–∑–≤–∏—á–∞–π –≤–æ–Ω–æ —Å—Ç–æ—Å—É–≤–∞–ª–æ—Å—è —Ä–µ–∫–ª–∞–º–Ω–∏—Ö —Ç–µ–∫—Å—Ç—ñ–≤ –Ω–∞ –ø–æ–ª—ñ—Ç–∏—á–Ω—É —Ç–µ–º–∞—Ç–∏–∫—É.</p>
